  src="https://kit.fontawesome.com/392284c9a4.js"
  crossorigin="anonymous"
></script>;

export default class Index extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return <Signup />;
  }
}
ReactDOM.render(<Index />, document.getElementById("root"));
